"use strict";

import {createElement} from "./createElement.js";
import {recountCaloriesAndPrice} from "./recountCaloriesAndPrice.js";
import {showListProducts} from "./showProductList.js";

let [body] = document.getElementsByTagName("body");

export function createOwnPizza() {

    let pizza = {
        name: "",
        ingredient: [],
        calories: 25,
        price: 3,
        categories: ["all"],
        image: "data:image/svg+xml;base64,"
    };


    let wrapOwn = createElement( body, "div");
    wrapOwn.className = "own-pizza-container";

    let wrapOwnPizza = createElement(wrapOwn, "div");
    wrapOwnPizza.className = "own-pizza-container__center";

    let cross = createElement(wrapOwnPizza, "a");
    cross.href = "#";
    cross.className = "own-pizza-container__center--cross";
    cross.innerText = "X";
    cross.onclick = function () {
        wrapOwn.remove()
    };

    let wrapImg = createElement(wrapOwnPizza, "div");
    wrapImg.className = "own-pizza-container__center__img-name";

    let img = createElement(wrapImg, "img");
    img.alt = "pizza";
    img.src = pizza.image;

    let labelName = createElement(wrapImg, "label");
    labelName.innerText = "Pizza name: ";

    let nameInput = createElement(labelName, "input");
    nameInput.type = "text";
    nameInput.placeholder = "Write name...";
    nameInput.onchange = function () {
        pizza.name = this.value;
    };

    let description = createElement(wrapOwnPizza, "div");
    description.className = "own-pizza-container__center__description";

    let wrapIngredient = createElement(description, "div");
    wrapIngredient.className = "own-pizza-container__center__description__wrap";

    let ingredient = createElement(wrapIngredient, "span");
    ingredient.className = "own-pizza-container__center__description__wrap__ingredient";

    let select = createElement(wrapIngredient, "select");
    select.id = "addToOwnPizza";

    let option = createElement(select, "option");
    option.value = "default";
    option.innerText = "add ingredients";


    [ "chicken", "dorBlue", "mozzarella",
        "cheeseMix", "mandarine", "tomato",
        "onion", "bacon", "jalapeno", "pork",
        "oregano", "peperoni", "ham", "mustard",
        "pickles", "champignon", "olives", "beef",
        "reganito", "pineapple", "garlic", "capsicum",
        "seafood" ].forEach( item => {
        let option = createElement(select, "option");
        option.value = item;
        option.innerText = item;
    } );

    select.onchange = function () {
        pizza.ingredient.push(this.value);
        ingredient.innerText += pizza.ingredient.length <= 1 ? this.value : ", " + this.value;
        recountCaloriesAndPrice(pizza, calories, price);
        if(this.value === "seafood" || this.value === "chicken" || this.value === "onion") {
            pizza.categories.push(this.value)
        }
        if(this.value === "jalapeno") {
            pizza.categories.push("spicy")
        }
        if(this.value === "pork" || this.value === "beef" || this.value === "ham" || this.value === "seafood") {
            for (let prop of pizza.categories) {
                if(!pizza.categories.includes("meat")) {
                    pizza.categories.push("meat");
                }
            }
        }
        if(this.value === "champignon") {
            pizza.categories.push("mushrooms")
        }
        this.value = "default";
    };

    let calories = createElement(description, "p");
    calories.className = "own-pizza-container__center__description__calories";
    calories.innerText = "Calorie content: 25 kCal";

    let wrapPrice = createElement(description, "div");
    wrapPrice.className = "own-pizza-container__center__description__price-create";

    let price = createElement(wrapPrice, "span");
    price.className = "own-pizza-container__center__description__price-create__price";
    price.innerText = " 3 $";

    let createBtn = createElement(wrapPrice, "a");
    createBtn.href = "#";
    createBtn.className = "own-pizza-container__center__description__price-create__btn";
    createBtn.innerText = "Create pizza";
    createBtn.onclick = function () {
        if(pizza.name.length === 0) {
            nameInput.classList.add("wrong");
        } else {
            let pizzas = JSON.parse(localStorage.getItem("_user-custom-pizzas-list"));
            pizzas.push(pizza);
            let str = JSON.stringify(pizzas);
            // localStorage.removeItem("_user-pizzas-list");
            localStorage.setItem("_user-custom-pizzas-list", str);
            showListProducts(pizzas);
            wrapOwn.remove()
        }
    }


}